import React, { useState } from "react";
import "./App.css";
import Form from "./components/Form";
// import { Button, Checkbox, Form, Input } from "antd";
const [inputText, setInputText] = useState("");

function App() {
  return (
    <div>
      <header>
        <h1>Masiro</h1>
      </header>
      <Form>
        inputText={inputText}
        setInputText={setInputText}
      </Form>
    </div>
  );
}
export default App;
